script: |
  super -f text -I q4082.spq | sort > q4082.out

inputs:
  - name: q4082.spq
    data: |
      SELECT DISTINCT - 31 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN col1 + + + ( - + col1 ) + + col1 AND + 74 + + - col1;
  - name: tab0

outputs:
  - name: q4082.out
    data: |
